
public class final_keyword {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		final int one = 1;
		final int two = 2;
		final int three = 3;
		final int four = 4;
		final int five = 5;
		
		System.out.println("The number one in symbol is " + one);
		System.out.println("The number two in symbol is " + two);
		System.out.println("The number three in symbol is " + three);
		System.out.println("The number four in symbol is " + four);
		System.out.println("The number five in symbol is " + five);
		
	}

}
